import React, { useState } from 'react';
import axios from 'axios';

const App = () => {
  const [response, setResponse] = useState('');

  const registerCompany = async () => {
    try {
      const response = await axios.post('http://localhost:3000/train/register', {
        companyName: 'Train Central',
        ownerName: 'Ram',
        rollNo: '1',
        ownerEmail: 'ran@abc.edu',
        accessCode: 'FKDLjg',
      });
      setResponse(JSON.stringify(response.data));
    } catch (error) {
      setResponse(JSON.stringify(error.response.data));
    }
  };

  return (
    <div>
      <button onClick={registerCompany}>Register Company</button>
      <pre>{response}</pre>
    </div>
  );
};

export default App;
